import React, { useState } from 'react';
import { 
  Grid, 
  Card, 
  CardContent, 
  Box, 
  Typography, 
  Tabs, 
  Tab,
  IconButton,
  Tooltip,
  useTheme 
} from '@mui/material';
import { 
  Refresh as RefreshIcon,
  MoreVert as MoreIcon,
  FilterList as FilterIcon
} from '@mui/icons-material';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip as ChartTooltip, ResponsiveContainer } from 'recharts';

// Simulated data - replace with your actual data
const alertTrends = [
  { name: 'Jan', value: 65 },
  { name: 'Feb', value: 59 },
  { name: 'Mar', value: 80 },
  { name: 'Apr', value: 81 },
  { name: 'May', value: 56 },
  { name: 'Jun', value: 55 },
];

const DashboardCard = ({ 
  title, 
  action, 
  children 
}: { 
  title: string; 
  action?: React.ReactNode; 
  children: React.ReactNode; 
}) => {
  const theme = useTheme();
  
  return (
    <Card 
      sx={{
        height: '100%',
        transition: 'transform 0.2s ease-in-out',
        '&:hover': {
          transform: 'translateY(-2px)',
          boxShadow: theme.shadows[4]
        }
      }}
    >
      <CardContent>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
          <Typography variant="h6" sx={{ fontWeight: 500 }}>
            {title}
          </Typography>
          {action}
        </Box>
        {children}
      </CardContent>
    </Card>
  );
};

const EnhancedDashboard = () => {
  const [timeRange, setTimeRange] = useState(0);
  const theme = useTheme();

  const handleRefresh = () => {
    // Implement refresh logic
    console.log('Refreshing dashboard data...');
  };

  return (
    <Box sx={{ p: 3 }}>
      {/* Dashboard Header */}
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Box>
          <Typography variant="h4" sx={{ fontWeight: 600, mb: 1 }}>
            Dashboard
          </Typography>
          <Typography variant="body1" color="text.secondary">
            Overview of system metrics and recent activities
          </Typography>
        </Box>
        <Box sx={{ display: 'flex', gap: 1 }}>
          <Tooltip title="Filter">
            <IconButton>
              <FilterIcon />
            </IconButton>
          </Tooltip>
          <Tooltip title="Refresh">
            <IconButton onClick={handleRefresh}>
              <RefreshIcon />
            </IconButton>
          </Tooltip>
        </Box>
      </Box>

      {/* Time Range Selector */}
      <Tabs
        value={timeRange}
        onChange={(_, newValue) => setTimeRange(newValue)}
        sx={{ mb: 3 }}
      >
        <Tab label="Today" />
        <Tab label="This Week" />
        <Tab label="This Month" />
        <Tab label="This Year" />
      </Tabs>

      <Grid container spacing={3}>
        {/* Trends Chart */}
        <Grid item xs={12} md={8}>
          <DashboardCard 
            title="Alert Trends"
            action={
              <IconButton size="small">
                <MoreIcon />
              </IconButton>
            }
          >
            <Box sx={{ height: 300 }}>
              <ResponsiveContainer width="100%" height="100%">
                <LineChart data={alertTrends}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="name" />
                  <YAxis />
                  <ChartTooltip />
                  <Line 
                    type="monotone" 
                    dataKey="value" 
                    stroke={theme.palette.primary.main} 
                    strokeWidth={2}
                    dot={{ r: 4 }}
                    activeDot={{ r: 6 }}
                  />
                </LineChart>
              </ResponsiveContainer>
            </Box>
          </DashboardCard>
        </Grid>

        {/* Add your existing components here with the new DashboardCard wrapper */}
        <Grid item xs={12} md={4}>
          <DashboardCard title="Statistics">
            <Box sx={{ height: 300, overflowY: 'auto' }}>
              {/* Your Statistics component */}
            </Box>
          </DashboardCard>
        </Grid>

        <Grid item xs={12}>
          <DashboardCard title="Recent Alerts">
            <Box sx={{ overflowX: 'auto' }}>
              {/* Your AlertList component */}
            </Box>
          </DashboardCard>
        </Grid>
      </Grid>
    </Box>
  );
};

export default EnhancedDashboard;
